import React, { useState } from 'react';

const App = () => {
    const [id, setId] = useState();
    const [pass, setPass] = useState();

    return <form>
        <h1>ID ascensor:</h1>
        <input placeholder="ID ascensor" onChange={e => setId(e.target.value)}/>

        <h1>password:</h1>
        <input placeholder="password" onChange={e => setPass(e.target.value)} />
        <hr/>
        <button onClick={() => {
        fetch(`http://localhost:3000/access/${id}/${pass}`)  
        }}><h3>SUBMIT</h3></button>
    </form>;
}
export default App;
